Tổng khối lượng 5 bao gạo là: 40 + 44 + 25 + 60 + 48 = 217 \text{ (kg)} 
Sau khi bán 1 bao gạo nếp thì tổng số bao gạo tẻ gấp 3 lần tổng số bao gạo nếp 
Suy ra số tổng khối lượng của bốn bao còn lại chia hết cho 4. 
Ta có: 217 : 4 dư 1 nên số bao gạo nếp bị bán đi chia 4 dư 1. 
Suy ra số bao gạo nếp bị bán đi là 25 kg. 
Số ki-lô-gam gạo nếp còn lại là: \frac{217 - 25}{1 + 3} \times 1 = 48 \text{ (kg)} 
Tổng số gạo nếp ban đầu là: 48 + 25 = 73 \text{ (kg)}

